"use strict";

var swiperRealized = new Swiper('.realized__swiper', {
  navigation: {
    nextEl: '.realized__button--prev',
    prevEl: '.realized__button--next'
  },
  pagination: {
    el: '.realized__pagination'
  },
  loop: true,
  speed: 750
});
var swiperPartners = new Swiper('.partners__swiper', {
  navigation: {
    nextEl: '.partners__button--next',
    prevEl: '.partners__button--prev'
  },
  slidesPerView: 'auto',
  loop: true,
  speed: 750
});
document.querySelectorAll('form').forEach(function (e) {
  e.addEventListener('submit', function (e) {
    e.preventDefault();
  });
});
// mobile menu
var burger = document.querySelector('.header__burger');
var menu = document.querySelector('.header__container');
var links = document.querySelectorAll('.header__link');
burger.addEventListener('click', function () {
  menu.classList.toggle('header__container-mobile--active');
  burger.classList.toggle('header__burger--active');
});
links.forEach(function (link) {
  link.addEventListener('click', function () {
    menu.classList.remove('header__container-mobile--active');
    burger.classList.remove('header__burger--active');
  });
});

//popup
var cards = document.querySelectorAll('.directions__card');
var close = document.querySelector('.popup__close');
var popup = document.querySelector('.popup');
cards.forEach(function (card) {
  card.addEventListener('click', function () {
    popup.classList.add('popup--active');
  });
});
close.addEventListener('click', function () {
  popup.classList.remove('popup--active');
});
